class BIT:

    def __init__(self, n):
        self.n = len(n) if type(n) == list else n
        self.bit = [0] * (self.n + 1)
        self.bit[0] = n[0] if type(n) == list else n

    def sum(self, i):
        s = 0
        while i > 0:
            s += self.bit[i]
            i -= i & -i
        return s

    def add(self, i, x):
        while i <= self.n:
            self.bit[i] += x
            i += i & -i

    def update(self, i, x):
        self.add(i, x - self.bit[i])

    def get(self, l, r=None):
        if r is None:
            r = l + 1
        s = 0
        while r > l:
            if r & 1:
                s += self.bit[r - 1]
                r -= 1
            if l & 1:
                s += self.bit[l]
                l += 1
            l >>= 1
            r >>= 1
        return s

    def lower_bound(self, w):
        if w <= 0:
            return 0
        i = 0
        k = 1
        while k < self.n:
            k <<= 1
        while k > 0:
            if i + k < self.n and self.bit[i + k] < w:
                w -= self.bit[i + k]
                i += k
            k >>= 1
        return i + 1


