import sys
from collections import deque


def solve():
    r, c = list(map(int, input().split()))
    maze = []
    for i in range(r):
        maze.append(list(input()))
    q = deque()
    for i in range(r):
        for j in range(c):
            if maze[i][j] == '.':
                q.append((i, j))
    while q:
        i, j = q.popleft()
        if i > 0 and maze[i - 1][j] == '.':
            maze[i - 1][j] = 'x'
            q.append((i - 1, j))
        if i < r - 1 and maze[i + 1][j] == '.':
            maze[i + 1][j] = 'x'
            q.append((i + 1, j))
        if j > 0 and maze[i][j - 1] == '.':
            maze[i][j - 1] = 'x'
            q.append((i, j - 1))
        if j < c - 1 and maze[i][j + 1] == '.':
            maze[i][j + 1] = 'x'
            q.append((i, j + 1))
    ans = 0
    for i in range(r):
        for j in range(c):
            if maze[i][j] == '.':
                ans += 1
    print(ans)


def __starting_point():
