    factors = []
    while i * i <= n:
        if n % i:
            i = i + 1
        else:
            n //= i
            factors.append(i)
    if n > 1:
        factors.append(n)
    return factors


def factorization(n):
    factors = {}
    temp = n
    for i in range(2, int(n ** 0.5) + 1):
        if temp % i == 0:
            count = 0
            while temp % i == 0:
                count = count + 1
                temp //= i
            factors[i] = count
    if temp > 1:
        factors[temp] = 1
    return factors


def divisors(n):
    i = 1
    factors = []
    while i * i <= n:
        if n % i == 0:
            if n // i == i:
                factors.append(i)
            else:
                factors.append(i)
                factors.append(n // i)
        i = i + 1
    return factors


