    if n < r:
        return 0
    numerator = reduce(mul, range(n, n - r, -1))
    denominator = reduce(mul, range(1, r + 1))
    return numerator // denominator


def isprime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    i = 5
    while i * i <= n:
        if n % i == 0 or n % (i + 2) == 0:
            return False
        i = i + 6
    return True


def prime_generator(n):
    if n >= 2:
        yield 2
    if n >= 3:
        yield 3
    i = 5
    step = 2
    while i <= n:
        if isprime(i):
            yield i
        step = 6 - step
        i += step


